window.bookSummaryJSON = "<p> Attract money and wealth into your life and harness the power of the Law of Attraction – while you sleep! You can use guided meditation to bring more money and abundance your way with this special program from certified hypnotherapist, Joel Thielke. It’s as easy as turning on the track and falling asleep! </p> <p>The Sleep Learning System is specially designed to work with your subconscious mind during your sleep cycle. The guided meditation and soothing background music will deeply relax your body and mind for the perfect night’s sleep, while allowing you to access the deepest parts of your mind for faster and longer learning. </p> <p>You’ll feel well rested, energized, and positive when you wake up, and you will start seeing opportunities for wealth and fortune that weren’t there before. </p> <p>Joel Thielke’s guided mediation system gives you positive suggestions that will help you retain the information and positive changes you need to fully embrace the Law of Attraction. The special Sleep Induction will gently guide you into your REM stage of sleep, working with your subconscious to make lasting change. </p> <p>This Sleep Learning System album comes with one long extended track that includes the Sleep Induction, guided meditation program, and bonus music and positive subliminals, providing hours of relaxation for your listening experience. </p> <p>Don’t wait another day to increase your wealth and success. Let your subconscious do the work for you while you sleep, and harness the Law of Attraction today! </p>"; 
